var React   = require('react');
var Scroll  = require('react-scroll');
var Helpers = Scroll.Helpers;

module.exports = Helpers.Element(Element);

var Link = React.createClass({
  render: function () {
    return (
      <a {...this.props}>
        {this.props.children}
      </a>
    );
  }
});

module.exports = Helpers.Scroll(Link);
